  function drawReputeChart(numgood, numbad, numother) {

        chart.draw(data, options);

function supports_html5_storage() {
  try {
    return 'localStorage' in window && window['localStorage'] !== null;
  } catch (e) {
    return false;
  }
}

function getCookie(c_name) {
  if (supports_html5_storage()) {
    try {
        return localStorage.getItem(c_name);
    } catch (e) {
        return false;
    }    
  } else  {
    if (document.cookie.length>0) {
      c_start=document.cookie.indexOf(c_name + "=");
      if (c_start!=-1) {
          c_start=c_start + c_name.length+1;
          c_end=document.cookie.indexOf(";",c_start);
          if (c_end==-1) c_end=document.cookie.length;
          return unescape(document.cookie.substring(c_start,c_end));
      }
    }
    return "";
  }
}

function setCookie(c_name,value,expiredays) {
  if (supports_html5_storage()) {
    try {
        localStorage.setItem(c_name, value);
        return;
    } catch (e) {
    }
  } else {
    var exdate=new Date();
    exdate.setDate(exdate.getDate()+expiredays);
    document.cookie=c_name+ "=" +escape(value)+
                     ((expiredays===null) ? "" : ";expires="+exdate.toUTCString());
  }
}

function doUpdate(geno) {
   url = 'http://www.snpedia.com/api.php?action=askargs&conditions='+geno+'&printouts=Repute|Magnitude|On+chromosome|Chromosome+position&format=json&parameters=|order%3Ddesc';
   //console.log('try '+url);
   $.ajax({
           url:      url,
           cache:    false,
           dataType: "jsonp",
           success:   function(data) {
              var Geno = geno.charAt(0).toUpperCase() + geno.slice(1);
              model.setGeno(geno, {
                    'repute' : data.query.results[Geno].printouts.Repute,
                    'magnitude' : data.query.results[Geno].printouts.Magnitude,
                    'chrom' :data.query.results[Geno].printouts['On chromosome'],
                    'pos' : data.query.results[Geno].printouts['Chromosome position']
                    });
            },
           error:   function(e, xhr) {
             console.log("failed");
             console.log(e);
             console.log(xhr);
           }
         });
    return false;

}






function realSetBoring(geno) {


   model.setGeno(geno, {
        'repute' : 'Good',
        'magnitude' : 0
        });


   url = 'http://www.snpedia.com/api.php?action=sfautoedit&form=Genotype&format=json&target='+geno+'&Genotype[repute]=Good&Genotype[magnitude]=0&wpSummary=promethease+editor+set+boring';
   //console.log('try '+url);
   $.ajax({
           url:      url,
           cache:    false,
           dataType: "jsonp",
           success:   function(data) {
              updateTable();
              updateChart();
            },
           error:   function(e, xhr) {
             console.log("failed");
             console.log(e);
             console.log(xhr);
           }
         });


}



function fakeSetBoring(geno) {
    model.setGeno(geno, {
        'repute' : 'Good',
        'magnitude' : 0
        });
    updateTable();
    updateChart();
    return false;
}



function setBoring(geno) {



  var understands = prompt('Going further will make a real change to SNPedia. It will set '+geno+' as magnitude=0 and repute=Good, which means boring. If you understand and want to make this change type: yes');

//      var understands = 'local';


  if (understands == 'yes') {

      realSetBoring(geno);
      alert('Done. If you add an exclamation point, next time I wont ask again');

  } else if (understands == 'yes!') {

      setBoring = realSetBoring;
      setBoring(geno);


  } else if (understands == 'local') {

      setBoring = fakeSetBoring;
      setBoring(geno);

  } else {

      model.setGeno(geno, {
            'repute' : 'Good',
            'magnitude' : 0
            });
      updateTable();
      updateChart();
      alert('I only changed your local version');
  }
  return false;
}

function doGetGenoParts(geno) {

   var Geno = geno.charAt(0).toUpperCase() + geno.slice(1);
   $.ajax({
           url:      'http://www.snpedia.com/api.php?action=query&prop=revisions&titles='+Geno+'/criteria&rvprop=content&format=json',
           cache:    false,
           dataType: "jsonp",
           success:   function(data) {
              for (var i in data.query.pages) {
                var text = data.query.pages[i].revisions[0]["*"];
                var seen = {};
                var matchterms = text.match(/\b([rg]s\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }
                matchterms = text.match(/\b(i\d+)\b/gi);
                if (matchterms) {
                    for (var idx in matchterms) {
                       chrom = matchterms[idx];
                       seen[chrom] = true;
                    }
                }

                var unique = new Array();
                for (var idx2 in seen) {
                    unique.push(idx2);
                }
                var textfilter = '('+geno+'|'+unique.join('|')+')';

                //console.log(textfilter);
                $('#textfilter').val(textfilter);
                updateGenos();

              }
            },
           error:   function(e, xhr) {
             console.log("failed");
             console.log(e);
             console.log(xhr);
           }
         });

}




if (typeof Array.prototype.push == 'undefined' ) {
    Array.prototype.push = function() {
     var i=0;
     var b=this.length;
     var a=arguments;
     for(i;i<a.length;i++) this[b+i]=a[i];
     return this.length;
   };
}


function showTags(p) {
     var o = new Array();
     if (p['tags']) {
         o.push('<div id="tags" class="col-xs-12">');
         o.push('<label class="linkedtolabel tooltipped" title="'+tooltipsTexts["LinkedTo"]+'"><i class="fa fa-tags"></i> Linked to</label> ');
         for(var u = 0; u < p['tags'].length; u++) {
             if (u > 0) {
                 o.push(' ');
             }
             o.push('<a class="label label-info taglink" href="#" >'+unescape(p['tags'][u])+'</a>');
         }
         o.push('</div>'); //tags
     }
     return o.join('');
}
function showClinVarDisease(p) {
  var o = new Array();
  if (p['clinvar_1']) {
      o.push('<div class="clinvar-label col-xs-12" href="#"><div class="panel">ClinVar ');

      var msg = 'unset';
      if (       p['clinvar_1']=='5') {
        msg = '<span class="label label-danger clinvar-label-important">Pathogenic</span>';
      } else if (p['clinvar_1']=='4') {
        msg = '<span class="label label-warning clinvar-label-warning">Probable-pathogenic</span>';
      } else if (p['clinvar_1']=='3') {
        msg = '<span class="label label-success clinvar-label-success">Probable-non-pathogenic</span>';
      } else if (p['clinvar_1']=='2') {
        msg = '<span class="label label-success clinvar-label-success">Non-pathogenic</span>';
      } else if (p['clinvar_1']=='1') {
        msg = '<span class="label label-success clinvar-label-success">Untested</span>';
      } else if (p['clinvar_1']=='7') {
        msg = '<span class="label label-info clinvar-label-info">Histocompatibility</span>';
      } else if (p['clinvar_1']=='6') {
        msg = '<span class="label label-info clinvar-label-info">Drug-response</span>';
      } else if (p['clinvar_1']=='255') {
        msg = '<span class="label label-info clinvar-label-info">Other</span>';
      } else {
        msg = '<span class="label label-danger clinvar-label-important">??</span>';
      }
      o.push(msg);

      if (p['clinvar_disease'] !== undefined) {
         var parts = p['clinvar_disease'].split(/;\s*/)
         for(var u = 0; u < parts.length; u++) {
           o.push(' <a class="clinvar_link label label-info" href="#" >'+unescape(parts[u])+'</a> ');
         }
      }
      o.push('</div></div>');
  }
  return o.join('');
}


function generateRsFormat(p) {

        repclass = badReputeClass;
    } else {
        repclass = 'noRepute';
    }


    o.push('<div class="'+repclass+'">');
    o.push('<div id="' + p['rsnum']+p['geno'] + '" class="boxresult row">');

}


function prepinRanges() {
    var slidermin = $( "#refslider-range" ).slider( "values", 0 );
    var slidermax = $( "#refslider-range" ).slider( "values", 1 );

    var refsusecompact = 1;

    var myinMagRange = prepareinMagRange();
    var myinFreRange = prepareinFreRange();


    var realfunction = function(p) {
        var v = myinMagRange(p);
        var magusecompact = !v;

        var numrefs = parseInt(p['numrefs'],10);
        var userefs = p['isASNP'];

        if (userefs) {
             if (numrefs < slidermin ) {
                  refsusecompact = 1;
             } else if (numrefs > slidermax ) {
                  refsusecompact = 1;
             } else if ((slidermin <= numrefs) && (numrefs <= slidermax )) {
                  refsusecompact = 0;
             } else {
                  refsusecompact = 1;
             }
             usebig = !magusecompact && !refsusecompact;
        } else {
             usebig = !magusecompact;
        }
        return usebig;
    };
    return realfunction;
}

function prepareinMagRange() {
    var magslidermin = $( "#magslider-range" ).slider( "values", 0 );
    var magslidermax = $( "#magslider-range" ).slider( "values", 1 );
    var usemag = true;
    var userefs = true;



    var realfunction = function(p) {
        var numrefs = parseInt(p['numrefs'],10);


        var mag = 1;
        if (p['magnitude'] === undefined) {
           mag = 1;
        } else {
           mag = parseFloat(p['magnitude']);
        }


        var magusecompact = 1;
        var refsusecompact = 1;

        if (usemag) {
             if (magslidermax < magslidermin ) {
                  magusecompact = 1;
             } else if (mag < magslidermin ) {
                  magusecompact = 1;
             } else if (mag > magslidermax ) {
                  magusecompact = 1;
             } else if (magslidermin <= mag && mag <= magslidermax ) {
                  magusecompact = 0;
             } else {
                  magusecompact = 1;
             }
        } else {
             magusecompact = 0;
        }

        return !magusecompact;
    };
    return realfunction;
}


function prepareinFreRange() {
    var requireFreq = $('input[name=filterFrequencies]').is(':checked');

    var freslidermin = $( "#freslider-range" ).slider( "values", 0 );
    var freslidermax = $( "#freslider-range" ).slider( "values", 1 );
    var usefre = true;

    var freq_is_acceptable = function(p) {

        if (!p['isASNP']) {
           return 1;
        }


        if (!requireFreq && p['freq'] === undefined ) {
           return 1;
        }

        if ( p['freq'] === undefined ) {
           return 0;
        }

        var fre = parseFloat(p['freq']);

        if (freslidermin <= fre && fre <= freslidermax ) {
                  return 1;
        }

        return 0;
    };
    return freq_is_acceptable;
}

function freqsortfunc(a,b) {
   if (a.freq === undefined &&  b.freq === undefined) {
      return 0;
   } else if (a.freq === undefined) {
      return 1;
   } else if (b.freq === undefined) {
      return -1;
   } else if (a.freq == b.freq) {
      return 0;
   } else if (a.freq > b.freq) {
      return 1;
   } else {
      return -1;

   }
}

   if (a.gmaf === undefined &&  b.gmaf === undefined) {

      return -1;
   } else if (a.gmaf == b.gmaf) {
      return 0;
   } else if (a.gmaf > b.gmaf) {
      return 1;
   } else {
      return -1;

   }
}

function magsortfunc(a,b) {
   if (a.original_index > b.original_index) {
      return 1;

   } else if (a.numrefs == b.numrefs) {

 function chrom2int(chrom) {
    var chromint;
    if (chrom == 'X') {
       chromint = 23;
    } else if (chrom == 'Y') {
       chromint = 24;
    } else if (chrom == 'MT') {
       chromint = 25;
    } else if (chrom === undefined) {
       chromint = 26;
    } else {
       chromint = parseInt(chrom,10);
    }
    return chromint;
 }

 function pseudoposition(adict) {
    var scale = 1000000000;
    var out = chrom2int(adict['chrom']) * scale + adict['pos'];
    return out;
 }

 function locationsortfunc(a,b) {
    posa = pseudoposition(a);
    posb = pseudoposition(b);

    if (isNaN(posa) &&  isNaN(posb)) {
       return 0;
    } else if (isNaN(posa)) {
       return 1;
    } else if (isNaN(posb)) {
       return -1;
    } else if (posa > posb) {
       return 1;
    } else if (posa < posb) {
       return -1;
    } else {
       return 0;
    }

 }
 function datesortfunc(a,b) {
    if (a.rstime && a.genotime) {
      timea = Math.max(a.genotime, a.rstime);
    } else if (a.rstime) {
      timea = a.rstime;
    } else {
      timea = a.genotime;
    }

    if (b.rstime && b.genotime) {
      timeb = Math.max(b.genotime, b.rstime);
    } else if (b.rstime) {
      timeb = b.rstime;
    } else {
      timeb = a.genotime;
    }

    if (isNaN(timea) &&  isNaN(timeb)) {
       return 0;
    } else if (isNaN(timea)) {
       return -1;
    } else if (isNaN(timeb)) {
       return 1;
    } else if (timea > timeb) {
       return -1;
    } else if (timea < timeb) {
       return 1;
    } else {
       return 0;
    }

 }

function insertInNewGraph(p, tags) {
    var title;
    if (p['title'] === undefined) {
       title = p['rsnum']+p['geno'];
    } else {
       title = p['title'];
    }

    var color = p['color'];
    var mag = 1;
    if (p['magnitude'] === undefined) {
       mag = 1;
    } else {
       mag = parseFloat(p['magnitude']);
    }

    if (mag < 1) {
      mag = 25;
    } else {
      mag = mag * 30;
    }

    newgraphseen[title] = newnodeidx;
    desc = p['desc'];
    if (desc === undefined) {
        desc = p['effect'];
    }
    var store = {nodeName:title, group:1, color:color, size:mag, idx:0, desc:desc};
    if (p['gene']) store['gene'] = p['gene'];
    newgraph.nodes.push(store);

    titleidx = newnodeidx;

    newnodeidx++;
    var tagidx;
    for (tagidx in p['tags']) {
        var tag = p['tags'][tagidx];

        if (!newgraphseen[tag]) {
             newgraphseen[tag] = newnodeidx;
             if (viewtag && viewtag == tag) {
                 newgraph.nodes.push({nodeName:tag, group:2, color:
                                     "lightblue", size:50, idx:newnodeidx});
             } else {
                 newgraph.nodes.push({nodeName:tag, group:2,
                                     color:"blue", size:20, idx:newnodeidx});
             }
             newnodeidx++;
        }
        newgraph.links.push(
            {source:titleidx, target:newgraphseen[tag], value:1});

     }
}

function warmupData() {
    maxrefs = -Infinity;
    maxmag = -Infinity;
    minmag = Infinity;
    maxfre = -Infinity;
    $.each(mygenos, function (i, p) {
        if (parseInt(p['numrefs'],10) > maxrefs) { maxrefs = parseInt(p['numrefs'],10); }
        if (parseFloat(p['freq']) > maxfre) { maxfre = parseFloat(p['freq']); }


        var mag = 1;
        if (p['magnitude'] === undefined) {
            mag = 1;
        } else {
            mag = parseFloat(p['magnitude']);
        }




        if (mag > maxmag) { maxmag = mag; }
        if (mag < minmag) { minmag = mag; }

        // remember this for sorting
        p['original_index'] = i;

        // turn the array of tags into a hash for faster lookup
        p['tag'] = {};
        var thelen = 0;
        if ('tags' in p) thelen = p['tags'].length;
        for(var u = 0; u < thelen; u++) {
              tag = p['tags'][u];
              p['tag'][tag] = true;

        }

        // it would be better to pre-cook these in promethease, than to split on the semicolon
        if (p.clinvar_disease) {
            p['clinvar_tag'] = {};
            $.each(p.clinvar_disease.split('; '), function(i, label) {
                p['clinvar_tag'][label] = true;
            });
        }

        // compute it only once
        p['isASNP'] = isASNP(p);

        if (p.isASNP) {
            if (rsinfo[p.rsnum]) {
                var mags = $.map(rsinfo[p.rsnum], function (key) {return key.mag;});
                if (mags.length) {
                    p['maxmag'] = Math.max.apply(Math, mags);
                }
            }
        }
    });

}

function prepisWanted(viewtag) {



    var filterReputeGood = !$('input[name=filterGood]').is(':checked');
    var filterReputeBad = !$('input[name=filterBad]').is(':checked');
    var filterReputeNotSet = !$('input[name=filterNotSet]').is(':checked');
    var filterRepute = filterReputeGood || filterReputeBad || filterReputeNotSet;

    var filterSNPs = !$('input[name=filterSNPs]').is(':checked');
    var filterGenosets = !$('input[name=filterGenosets]').is(':checked');
    var filterFrequencies = $('input[name=filterFrequencies]').is(':checked');






    var filterclinvar = false;

    var textfilter = $( '#textfilter' ).val( );
    var filterclinvar_disease = $( '#' ).val( );
    //var filterclinvar = false;
    //var clinsigwanted = Object();


    //console.log(clinsigwanted);
    if ( clinsigwanted.length ) {
        console.log('allow filter clinvar');
        filterclinvar = true;

        if (clinsigwanted['999']) {
           filterclinvar = false;
           console.log('allowing all, and disabling filter clinvar');
        }
    }


    var doChrRegex = false;
    if (textfilter) {

       if ( textfilter.match(/\/CLNSIG=/) ) {
          var clinsigmatch = textfilter.match(/\/CLNSIG=(\S+)/);
          if (clinsigmatch) {
            filterclinvar = true;
            clinsigwanted = clinsigmatch[1].split(/,/)
          }
       }
       if ( textfilter.match(/\/COUNT.?=\d+/) ) {
          var match_count = textfilter.match(/\/COUNT(.?=)(\d+)/);
          if (match_count) {
            filter_count = true;
            filter_count_OP = match_count[1];
            filter_count_N = match_count[2];
          }
       }

       if ( textfilter.match(/^\/\w+/) ) {
          textfilter = textfilter.replace(/\s*\/\w+=?\S*/g,'');
       }

       if ( textfilter.match(/^chr/) ) {
           doChrRegex = true;
           var chrom = undefined;
           var startpos = undefined;
           var endpos = undefined;
           var matchchrom = textfilter.match(/^chro?m?\s*([0-9xymt]+)/i);
           if (matchchrom) {
             chrom = matchchrom[1].toUpperCase();
             var matchanchor = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*(\d+)/);
             if (matchanchor) {

                  // found chr 3:5000-8000

                  startpos = parseInt(matchanchor[1], 10);
                  var matchrange = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*[-:](\d+)/i);
                  if (matchrange && matchrange[1]) {
                     thepos = parseInt(matchrange[1], 10);
                     if (thepos > startpos) {
                         endpos = thepos;
                     }

                  } else {
                     // found chr 3:5000+3000
                     var matchplus = textfilter.match(/^chro?m?\s*[0-9xymt]+\s*:\s*\d+\s*\+(\d+)/i);
                     if (matchplus && matchplus[1]) {
                         thepos = parseInt(matchplus[1], 10);
                         endpos = startpos+thepos;
                     }
                  }
             }
           }
       }
    }



    var all_allowed = clinsigwanted['999']
    var myinMagRange = prepareinMagRange();
    var myinRanges = prepinRanges();
    var myinFreRange = prepareinFreRange();

    var isWantedCheck = function (p) {

        if(viewtag && !p['tag'][viewtag]) return false;

        // piechart
        if (!(viewtag_clinvar_disease === undefined)) {
          if(viewtag_clinvar_disease) {
             var keyname='clinvar_disease';
             var keep = false;
             if (p[keyname]) {
                 var parts = p[keyname].split(/;\s*/);
                 for(var u = 0; u < parts.length; u++) {
                   var v = parts[u];
                   if (v == viewtag_clinvar_disease) {
                       keep = true;
                   }
                 }
             }
             if (!keep) { return false; }
          }
        }




        if (!(viewtag_gene === undefined)) {
          if(viewtag_gene) {
             if (p.gene != viewtag_gene) {
                 return false;
             }
          }
        }



        if (!all_allowed) {
              if (!clinsigwanted[p['clinvar_1']]) {
                 return false;
              }
        }

        if (filterRepute) {
           var repute = p['repute'];
           if (repute == 'Good' && filterReputeGood) return false;
           if (repute == 'Bad' && filterReputeBad) return false;
           if (repute === undefined && filterReputeNotSet) return false;
        }

        if (filter_count_N) {
           if (p.count < filter_count_N) return false;
        }

        if (filterclinvar) {
            console.log('filterclinvar');
            var clinsig = p['clinvar_1'];
            console.log(clinsig);
            var match = false;
            if (!(clinsig === undefined)) {
                 if (clinsigwanted[String(clinsig)]) {
                         match = true;
                 }
            }
            if (!match) return false;
        }


        if (textfilter) {
           var match;
           if ( doChrRegex ) {
               match = true;
               if (match && p.chrom != chrom) match = false;
               if (match && p.pos < startpos) match = false;
               if (match && p.pos > endpos && endpos > startpos) match = false;
               if (!match) return false;
           } else {
               match = false;
               var patt=new RegExp(textfilter,'i');
               if (p.rstext && patt.test(p.rstext)) match = true;
               if (!match && p.title && patt.test(p.title)) match = true;
               if (!match && !p.title && patt.test(p.rsnum+p.geno)) match = true;

               if (!match && p.clinvar_disease) {
                 var clinvar_diseases = p.clinvar_disease.split(/;\s*/)
                 for(var u = 0; !match && u < clinvar_diseases.length; u++) {
                    if (patt.test(clinvar_diseases[u])) match = true;
                 }
               }

               if (!match && p.genobody && patt.test(p.genobody)) match = true;
               if (!match && p.genosummary && patt.test(p.genosummary)) match = true;
               if (!match && p.gene && patt.test(p.gene)) match = true;
               if (!match && p.dbsnp && patt.test(p.dbsnp)) match = true;
               if (!match && p.tags) {
                   var tagidx;
                   for (tagidx in p['tags']) {
                      if (!match && patt.test(p['tags'][tagidx])) match = true;
                   }
               }
               if (!match) return false;
           }
        }

        if (p['isASNP']) {
            if (p['freq'] === undefined)
            {
                if(filterFrequencies)
                {
                    return false;
                }
            }
          if (filterSNPs) return false;
          if (myinRanges(p) && myinFreRange(p)) return true;
        } else {
              if (filterGenosets) return false;
              if (myinMagRange(p) && myinFreRange(p)) {return true;}
        }

        return false;
    };
    return isWantedCheck;
}

function grouper(asummary, parts, p) {

    for(var u = 0; u < parts.length; u++) {
                    var v=parts[u];


                    if(!asummary.hasOwnProperty(v)) {
                        var c_var={name:v,rsnums:{},rsnums_good:{},rsnums_bad:{},rsnums_notset:{},num_good:0,num_bad:0,num_notset:0}
                        asummary[v]=c_var;
                    }

                    if(asummary[v].rsnums.hasOwnProperty(p.rsnum)) {
                        asummary[v].rsnums[p.rsnum]+=1;
                    }
                    else {
                        asummary[v].rsnums[p.rsnum]=1;
                    }

                    if(!p.hasOwnProperty("repute")) {
                        if(asummary[v].rsnums_notset.hasOwnProperty(p.rsnum)) {
                            asummary[v].rsnums_notset[p.rsnum]+=1;
                        }
                        else {
                            asummary[v].rsnums_notset[p.rsnum]=1;
                        }
                        asummary[v].num_notset+=1;
                    }

                    if(p.repute=="Good") {
                        if(asummary[v].rsnums_good.hasOwnProperty(p.rsnum)) {
                            asummary[v].rsnums_good[p.rsnum]+=1;
                        }
                        else {
                            asummary[v].rsnums_good[p.rsnum]=1;
                        }
                        asummary[v].num_good+=1;
                    }


                    if(p.repute=="Bad") {
                        if(asummary[v].rsnums_bad.hasOwnProperty(p.rsnum)) {
                            asummary[v].rsnums_bad[p.rsnum]+=1;
                        }
                        else {
                            asummary[v].rsnums_bad[p.rsnum]=1;
                        }
                            asummary[v].num_bad+=1;
                    }
    }

}

function getBarChart(obj_chart)
    {
        var tab_chart="";
        if(obj_chart.data.length > 0)
        {
            var total_value=0;
            for(i=0;i<obj_chart.data.length;i++)
            {
                total_value+=obj_chart.data[i].value;
            }
            tab_chart+='<table class="table" cellpadding="0" cellspacing="0" border="0" width="'+obj_chart.options. width+'" height="'+obj_chart.options.height+'" style="'+obj_chart.options.css+'">';
            tab_chart+='<tr>';
            for(i=0;i<obj_chart.data.length;i++)
            {
                var w_percent=(obj_chart.data[i].value*100)/total_value;
                if (w_percent) {
                    tab_chart+='<td width="'+w_percent+'%" bgcolor="'+obj_chart.data[i].color+'"></td>';
                }
            }
            tab_chart+='</tr>';
            tab_chart+='</table>';
        }
        return tab_chart;

    }

function genosHTML() {

  var blocks = new Array();
  var maxitems = parseInt($( '#maxitems' ).val( ),10);
  if (!maxitems) {
     $( '#maxitems' ).val( 10 );
     maxitems = 10;
  }

  var count = 0;
  var skipped = 0;
  var missed = 0;
  var masked = 0;

  var myisWanted = prepisWanted(viewtag);
  var myinRanges = prepinRanges();

  model.each(function (i, p) {
      var skip = 0;
      if (count >= maxitems) {
         skipped++;
         skip++;
      }
      if(viewtag && !p['tag'][viewtag]) return;
  
      var wanted = myisWanted(p);
      if (!wanted) return;
  
      if (clinsigwanted) {
       if (!clinsigwanted['999']) {
          if (!clinsigwanted[p['clinvar_1']]) {
              return;
          }
       }
      } else {
              console.log('  early undef');
      } 
  
  
      if (p['isASNP']) {
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateRsFormat(p));
                 count++;
             }  else {
                 masked++;
             }
          } else {
             missed++;
          }
      } else if(!(p['title']===undefined)) {
  
          if (!skip) {
             if (myinRanges(p)) {
                 blocks.push(generateGenosetFormat(p));
                 count++;
             } else {
                 masked++;
             }
          } else {
             missed++;
          }
        }
  });


  if (missed) {
      blocks.push('<div id="footerBox">');
      blocks.push('<div id="footer"  class="boxresult">');
      blocks.push('<button class="tooltipped btn btn-block btn-default btn-md" title="Fast way to allow twice as many visible rows" id="more" onclick="wantmore();">2x more</button>');
      blocks.push('</div>');
      blocks.push('</div>');
  }
  
  $( "#num_missed" ).val( missed );
  $( "#num_count" ).val( count );
  
  return blocks.join('');
}

   $( '#maxitems' ).val( 10 );

var count = 0;
var skipped = 0;
var missed = 0;

var myinRanges = prepinRanges();

model.each(function (i, p) {
    if(viewtag && !p['tag'][viewtag]) return;
    if(viewtag_clinvar_disease && p['clinvar_tag'] && !p['clinvar_tag'][viewtag_clinvar_disease]) return;
    if(viewtag_gene && p.gene != viewtag_gene) return;
    var wanted = myisWanted(p);
    if (!wanted) return;

    if (myinRanges(p)) {
               if (p.repute == 'Good') {

                  numbad += 1;
               } else if (p.repute === '') {
                  numother += 1;
               } else {
                  numother += 1;
               }
    }
});
drawReputeChart(numgood, numbad, numother);
}

function setSort(name) {
var reverse = false;
var sortf = magsortfunc;
var suffix = '-rev';
if        (name.indexOf('magnitude') === 0)  { sortf = magsortfunc;
} else if (name.indexOf('maxmagnitude') === 0)  { sortf = maxmagsortfunc;
} else if (name.indexOf('frequency') === 0)  { sortf = freqsortfunc;
} else if (name.indexOf('gmaf') === 0)  { sortf = gmafsortfunc;
} else if (name.indexOf('references') === 0) { sortf = refsortfunc;
} else if (name.indexOf('location') === 0)   { sortf = locationsortfunc;
} else if (name.indexOf('mod-date') === 0)   { sortf = datesortfunc;
}

if (name.indexOf(suffix, name.length - suffix.length) !== -1) reverse = true;

model.setFlag('reverse', reverse);
model.setSort(sortf);

updateTable();
return false;
}

function jq(myid) {
return '#' + myid.replace(/([\(\)\;])/g,'\\$1');
}

function toggleRstext(thing) {
name = jq(thing)+' .rstext';
rstext = $(name);
if (rstext.is(':visible')) {
  rstext.hide();
  rstext.parent()[0].children[1].textContent = 'more ...';
} else {
  rstext.show();
  rstext.parent()[0].children[1].textContent = 'less ...';
}
return false;
}

/AMsv++f/AK9FFADxr17/ANMv++f/AK9L/b176Rf98/8A16KKAEOv3o7Rf98//XpP+EhvfSL/AL5/+vRRQAn/AAkN96Rf98//AF6X/hIL30i/75/+vRRQAf2/e/8ATL/vn/69C69ekn/Vcf7P/wBeiigBya9eFRxF0/u//Xp/9u3npF/3z/8AXoooAT+3bz0i/wC+f/r0f29eekX/AHz/APXoooAP7dvPSL/vn/69B1289Iv++f8A69FFADTr17/0y/75/wDr00a9e5IxFx/s/wD16KKAH/27ef8ATL/vn/69NbXr3/pl/wB8/wD16KKAIjr16WA/df8AfH/16aNevSf+WXf+D/69FFAEg169/wCmX/fH/wBenjXr3/pl/wB8/wD16KKAF/t689Iv++f/AK9Idevf+mX/AHz/APXoooAYdfvf+mX/AHx/9emHX70f88v++f8A69FFAB/b16uD+65wfuf/AF6Ua/fYz+6/74/+vRRQA7/hIb4f88v++f8A69KPEV9j/ll/3xRRQAf8JFfZ/wCWX/fH/wBej/hIL3/pl/3z/wDXoooAadfvScfuuf8AY/8Ar0i69ejoIh/wD/69FFADhr17/wBMv++P/r04a9e/9Mv++P8A69FFAC/29e4/5Zf98/8A16T+370sB+6/75/+vRRQAweILojJWPJ+v+NFFFAH/9k="}, {"title": "gs241", "color": "#FFFFD0", "tags": ["Eye color"], "genotime": 20150430235403, "genosummary": "lighter green, brown or hazel eye color", "magcolor": "#FF9090", "magnitude": 3.0, "genobody": "You have a variant linked to blue eye color, but also less common eye color variations. This is common among western europeans with green, light brown or hazel eye color. This spreadsheet is gathering more information on eye color and genotypes. See gs237 for one version of blue eyes.", "imgurl": null}, {"title": "gs273", "color": "#FFFFD0", "tags": ["23andMe/SNPs", "Atrial fibrillation", "Stroke"], "genotime": 20131206203818, "genosummary": "Lowest risk (13% of white women) of Atrial Fibrillation reported by 23andMe", "magcolor": "#FF9090", "magnitude": 3.0, "genobody": "The two atrial fibrillation SNPs mentioned by 23andMe are both normal. This causes the heart to form normally and gives the lowest risk of Atrial Fibrillation (quivering of the top part of the heart) that 23andMe reports. It also seems to lower the risk of Cardioembolic ischemic stroke (blocked blood flow to the brain) although 23andMe doesn't mention that. For European women, 23andMe reports this as a 13.0% risk, compared to the 15.9% average. The risk is higher for men. Based on many quality studies, and confirmed for Europeans and partly for Asians.", "repute": "Good", "imgurl": null}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs9275596", "pos": "32713854", "frequency": "11.5%", "stabilized_orientation": "plus", "freqcolor": "#FFA8A8", "numrefs": 2, "genosummary": "3x increased risk for developing a peanut allergy", "genobody": "In populations of European ancestry, having two copies of a rs9275596(C) allele is associated with 3x increased risk for developing a peanut allergy.", "repute": "Bad", "tags": ["Food allergy"], "effect": "3x increased risk for developing a peanut allergy  In populations of European ancestry, having two copies of a rs9275596(C) allele is associated with 3x increased risk for developing a peanut allergy.", "gmaf": 0.2645, "freq": 11.5, "chrom": "6", "rstext": "rs9275596 is a SNP located between the HLA-DQB1 and HLA-DQA2 genes on chromosome 6. A study of several thousand children and their parents, most with food allergies, concluded that two SNPs, rs7192 and rs9275596, are associated with increased susceptibility to developing a peanut allergy in populations of European ancestry. The odds ratio reported for rs9275596(C) were 1.7 (p=10e-10). Association of systemic lupus erythematosus with C8orf13-BLK and ITGAM-ITGAX. Genome-wide association analysis of susceptibility and clinical phenotype in multiple sclerosis. A two-stage search strategy for detecting multiple loci associated with rheumatoid arthritis. Kidney Disease  [GWAS:None]", "rstime": 20150623205056, "magcolor": "#FF9090", "geno": "(C;C)", "magnitude": 3.0, "gene": "LOC100507686"}]);

inding", "numrefs": 63, "genosummary": "higher risk of of coronary heart disease", "genobody": "coronary heart disease", "repute": "Bad", "tags": ["Cholinesterase Inhibitors", "Coronary artery disease", "Heart disease", "Ovarian cancer", "PharmGKB", "Venous thromboembolism"], "effect": "higher risk of of coronary heart disease  coronary heart disease", "magcolor": "#FF9090", "gmaf": 0.4835, "freq": 43.4, "chrom": "7", "rstext": "rs662, also known as Q192R, is a SNP in the PON1 gene. It codes for amino acid 192 of the paraoxonase (PON) protein. Variants of this SNP affect PON catalytic efficiency and are correlated with Heart disease and trait-anxiety scores. The normal form, rs662(A), encodes a glutamine (Q), while the variant, rs662(G)), encodes an arginine (R). . While some populations show an association between this SNP and Heart disease, not all do. Perhaps the most striking finding was reported in Japanese patients with non-insulin dependent diabetes mellitus (NIDDM). NIDDM patients with either one or two rs662(G) alleles had a 9 fold higher risk of coronary heart disease compared with rs662(A;A) NIDDM patients. table of odds for cardiovascular disease outcomes 274 ovarian epithelial carcinoma cases and 452 ...", "rstime": 20150709054934, "geno": "(A;A)", "magnitude": 2.3, "gene": "PON1"}, {"orientation": "plus", "clinvar_1": "255", "color": "#FF9090", "rsnum": "rs3825942", "pos": "73927241", "frequency": "68.3%", "stabilized_orientation": "minus", "freqcolor": "#FFEDED", "clinvar_disease": "Exfoliation syndrome", "numrefs": 45, "genosummary": "common but 10x higher glaucoma risk in most (but not all) populations", "genobody": "This genotype is found in 2 out of 3 people, but has been repeatedly linked to a much higher risk of glaucoma. However a 2010 paper in a south african population reports reduced risk, casting some doubts.", "repute": "Bad", "tags": ["Ageing", "Glaucoma"], "effect": "common but 10x higher glaucoma risk in most (but not all) populations  This genotype is found in 2 out of 3 people, but has been repeatedly linked to a much higher risk of glaucoma. However a 2010 paper in a south african population reports reduced risk, casting some doubts.", "magcolor": "#FF9090", "gmaf": 0.225, "freq": 68.3, "chrom": "15", "rstext": "rs3825942, also known as G153D, a SNP causing an amino acid change in the lysyl oxidase 1 LOXL1 gene, has been linked to exfoliation glaucoma (also known as exfoliation syndrome). This form of glaucoma causes up to 10% of the cases of blindness in many countries, including the US. From the abstract of this study: 'Approximately 25% of the general population is homozygous for the highest risk haplotype [C;C here combined with other risk SNPs] and their risk of suffering XFG (exfoliation glaucoma) is over 100 times that of those only carrying low-risk haplotypes.' The risk allele for this SNP is rs3825942(C), as oriented with respect to the dbSNP entry, and it confers a estimated relative risk (by itself) of 27 compared to the (T) allele. The odds ratio is 20.10 (CI 10.80-37.41). [Note that ...", "rstime": 20150714042327, "geno": "(C;C)", "magnitude": 2.3, "gene": "LOXL1"}, {"title": "gs280", "color": "#FFFFD0", "tags": ["Appearance"], "genotime": 20140401042727, "genosummary": "Light hair color for europeans", "magcolor": "#FF9090", "magnitude": 2.2, "genobody": "You have one of the SNPs linked to light color hair. *rs12821256(C;C) *rs35264875(T;T) *rs12896399(G;G)", "imgurl": null}, {"orientation": "plus", "effect": "2.6x increased thyroid cancer risk", "genosummary": "2.6x increased thyroid cancer risk", "color": "#FF9090", "rsnum": "rs944289", "frequency": "38.9%", "rstime": 20150719000405, "pos": "36180040", "tags": ["23andMe/SNPs", "Thyroid cancer"], "geno": "(T;T)", "magcolor": "#FF9090", "magnitude": 2.2, "stabilized_orientation": "plus", "genobody": "", "freqcolor": "#FFD4D4", "gmaf": 0.4288, "repute": "Bad", "freq": 38.9, "chrom": "14", "rstext": "Each A at rs965513 increased the odds of thyroid cancer by 1.75 times. Each T at rs944289 increased the odds of thyroid cancer by 1.37 times. A genoset, Gs137, has also been created in SNPedia to represent the increased risk reported for carriers of both variants. See also: 23andMe blog  [PharmGKB:Non-Curated GWAS results: Common variants on 9q22.33 and 14q13.3 predispose to thyroid cancer in European populations. (Initial Sample Size: 192 cases, 37,196 controls; Replication Sample Size: 432 cases, 1,727 controls); (Region: 14q13.3; Reported Gene(s): NKX2-1; Risk Allele: rs944289-T); (p-value= 0.000000002).This variant is associated with Thyroid cancer.] [OMIM:THYROID CARCINOMA, PAPILLARY]", "numrefs": 15}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs2165241", "pos": "73929861", "frequency": "43.4%", "stabilized_orientation": "plus", "freqcolor": "#FFD9D9", "numrefs": 36, "genosummary": "4.4x increased risk of exfoliation glaucoma", "genobody": "glaucoma risk likely to actually be based on nearby rs3825942", "repute": "Bad", "tags": ["23andMe/SNPs", "Glaucoma"], "effect": "4.4x increased risk of exfoliation glaucoma  glaucoma risk likely to actually be based on nearby rs3825942", "gmaf": 0.3136, "freq": 43.4, "chrom": "15", "rstext": "This SNP, located in an intron of the LOXL1 gene, was initially reported to be associated with exfoliation glaucoma. However, it was shown in the same study to no longer be significant once two other SNPs, which cause actual changes in the LOXL1 protein, were identified. More specifically, the risk allele rs2165241(T) was found to be associated with glaucoma only because it effectively predicted (with 90% probability) the actual high-risk haplotype consisting of rs1048661(G) and rs3825942(C), as oriented with respect to their entries in dbSNP. However, a meta-analysis published in 2010 concluded that it's likely that SNPs rs1048661 and rs2165241 are not directly implicated in the pathogenesis of glaucoma; only the nearby rs3825942 seemed to be the disease-associated SNP. rs2165241 was sign...", "rstime": 20150623195247, "magcolor": "#FF9090", "geno": "(C;T)", "magnitude": 2.2, "gene": "LOXL1"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs1136287", "pos": "1769982", "frequency": "48.7%", "stabilized_orientation": "plus", "freqcolor": "#FFDEDE", "numrefs": 10, "genosummary": "3.9x increased risk of wet ARMD", "genobody": "age related macular degeneration", "repute": "Bad", "tags": ["Age related macular degeneration", "PharmGKB"], "effect": "3.9x increased risk of wet ARMD  age related macular degeneration", "gmaf": 0.3526, "freq": 48.7, "chrom": "17", "rstext": "rs1136287, also known as Met72Thr, is a SNP in the PEDF gene. Analysis of 86 Taiwanese Chinese patients with wet age related macular degeneration (ARMD) found the (T) allele to be more frequent in patients than in controls (50% vs 31%; p =.0005). The rs1136287(T;T) genotype was also more prevalent in patients than in controls (odds ratio 3.9, p = .0015).", "rstime": 20150101010152, "magcolor": "#FF9090", "geno": "(T;T)", "magnitude": 2.2, "gene": "SERPINF1"}, {"orientation": "minus", "clinvar_1": "255", "color": "#FF9090", "rsnum": "rs2231137", "pos": "88139962", "frequency": "96.9%", "stabilized_orientation": "minus", "freqcolor": "#FFFDFD", "clinvar_disease": "Uric acid concentration; Blood group", "numrefs": 6, "genosummary": "~1.5-3x increased risk for ischemic stroke", "genobody": "", "repute": "Bad", "tags": ["PharmGKB", "Stroke"], "effect": "~1.5-3x increased risk for ischemic stroke", "magcolor": "#FF9090", "gmaf": 0.1405, "freq": 96.9, "chrom": "4", "rstext": "rs2231137, also known as Val12Met, is a SNP in the ATP-binding cassette, sub-family G (WHITE), member 2 ABCG2 gene. The (G) allele encodes the Val. In a study of incident ischemic stroke during 14 years of follow-up in a population-based study of older adults known as the Cardiovascular Health Study (CHS), rs2231137 was associated with stroke in both white (hazard ratio, 1.46, CI: 1.05 - 2.03) and black (hazard ratio, 3.59, CI, 1.11 - 11.6) participants. The risk of ischemic stroke was higher in Val allele homozygotes than in Met allele carriers. The adjusted hazard ratio for Val allele homozygotes, compared with Met allele carriers, was 1.50 (90% CI, 1.06 to 2.12) in whites and 3.62 (90% CI, 1.11 to 11.9) in black participants (Table 4).  [PharmGKB:Curated control size=7; M12 cases=6; PK=...", "rstime": 20150707174037, "geno": "(G;G)", "magnitude": 2.2, "gene": "ABCG2"}, {"orientation": "plus", "color": "#FF9090", "rsnum": "rs1360780", "pos": "35639794", "frequency": "6.2%", "stabilized_orientation": "plus", "freqcolor": "#FF9696", "numrefs": 39, "genosummary": "1.3x increased risk for depression", "genobody": "", "repute": "Bad", "tags": ["Antidepressants", "Citalopram", "Depression", "PharmGKB", "Post-traumatic stress disorder"], "effect": "1.3x increased risk for depression", "gmaf": 0.2994, "freq": 6.2, "chrom": "6", "rstext": "In Caucasian non-Hispanics, the rs1360780(T) allele is associated with increased risk for depression, with an odds ratio of 1.39 (CI: 1.14-1.70, p=0.046). This same SNP, which is in the FKBP5 gene, may influence how patients respond to antidepressants including citalopram. rs1360780(T;T) homozgyotes tend to report more depressive episodes, but they also respond better to treatment with antidepressants. rs9296158 rs3800373 rs1360780 rs9470080 linked with the severity of child abuse to predict level of adult PTSD symptoms after correcting for multiple testing.  [PharmGKB:Curated This variant is associated with higher chance of response to anti-depressant drugs.] [OMIM:FK506-BINDING PROTEIN 5; FKBP5]", "rstime": 20150623100645, "magcolor": "#FF9090", "geno": "(T;T)", "magnitude": 2.1, "gene": "FKBP5"}]);

function Model (type) {
this._all = undefined;
this.other = {'start':'here'};


this.loadRaw = function(allgenos) {
     this._all = allgenos;
};

this.setGeno = function(title, thedict) {
    var thethe = $.grep(this._all, function(p, i) {
         if (p.title) {
              return ( p && p.title == title );
         } else {
              return ( p && (p.rsnum+p.geno) == title );
         }
         });
     $.each(thedict, function (k,v) {
        thethe.forEach(function (x) {x[k] = v;});
     });
    };


this.setSort = function(thefunc) {
    //console.log('setting sort');
    this.other.sort = thefunc;
};
this.getSort = function() {
    //console.log('getting sort');
    return this.other.sort;
};
this.setFlag = function(key, value) {
    //console.log('really setting '+key+' = '+value);
    this.other[key] = value;
};
this.getFlag = function(key) {
//        console.log('getting '+key+' = ?');
    return this.other[key];
};



this.each = function (f) {
   doRev = model.getFlag('reverse');

   showGood = $('#filterGood');
   showBad = $('#filterBad');
   showNotSet = $('#filterNotSet');

   g = function(i, p) {
      if ((showGood   || !showGood   && p.repute == 'Good') &&
          (showBad    || !showBad    && p.repute == 'Bad') &&
          (showNotSet || !showNotSet && !p.repute))
         return f(i,p);
   };



   if (doRev) {
     return $.each(model._all.sort(model.getSort()).reverse(), f);
   } else {
     return $.each(model._all.sort(model.getSort()), f);
   }
};

}

function View (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}

function Controller (type) {
this.type = type;
this.color = "red";
this.getInfo = function() {
    return this.color + ' ' + this.type + ' apple';
};
}
